import React from "react";

function CarForm({ brand, model, price, color, setBrand, setModel, setPrice, setColor, year, setYear, handleAdd,reset}) {
  return (
    <div>
      <input
        type="text"
        placeholder="Brand"
        value={brand}
        onChange={(e) => setBrand(e.target.value)}
      />

      <input
        type="text"
        placeholder="Model"
        value={model}
        onChange={(e) => setModel(e.target.value)}
      />

      <input
        type="number"
        placeholder="Year"
        value={year}
        onChange={(e) => setYear(e.target.value)}
      />

      <input
        type="number"
        placeholder="Price"
        value={price}
        onChange={(e) => setPrice(e.target.value)}
      />

      <input
        type="text"
        placeholder="Color"
        value={color}
        onChange={(e) => setColor(e.target.value)}
      />

      <button onClick={handleAdd}>Add Car</button>
       <button onClick={reset}>Reset</button>
    </div>
  );
}

export default CarForm;
